import React from 'react';
import './toggle_button/toggle_button';
import './sidemenu.css';

const Sidemenu = (props) => {
    return (
        <nav className="sidemenu">
            <ul>
                <li> <a href="/"> Products</a>  </li>
                <li> <a href="/"> Users</a>  </li>
            </ul>
        </nav>
    )
}

export default Sidemenu;
